import React from 'react';
import { Link } from 'react-router-dom';
import './Navbar.css'; 
import { FaEdit } from 'react-icons/fa';
import { faEdit } from '@fortawesome/free-solid-svg-icons';

const Navbar = () => {
    return (
        <>
        {/* <h1 style={{ textAlign: 'center', marginTop: '20px' }}>Content Creator</h1> */}
        <nav >
            <ul style={{ display: 'flex', justifyContent: 'space-around', listStyleType: 'none', margin: 0, padding: 0 }}>
                <li>
                    <Link to="/" style={{ color: '#fff', textDecoration: 'none' }}>Home</Link>
                </li>
                <li>
                    
                    <Link to="/profile" style={{ color: '#fff', textDecoration: 'none' }}>Profile View</Link>

                </li>
                <li>
                    {/* <Link to="/profile/edit" style={{ color: '#fff', textDecoration: 'none' }}><Faprofileiconedit></Faprofileiconedit></Link> */}
                    <Link to="/profile/edit" style={{ color: '#fff', textDecoration: 'none' }}>
                   <FontAwesomeIcon icon={faEdit} />
    </Link>
                </li>
            </ul>
        </nav>
        </>
    );
};

export default Navbar;
